  `MobilePhone` varchar(30) DEFAULT NULL,
  `Fax` varchar(30) DEFAULT NULL,
  `EMail` varchar(241) DEFAULT NULL,
  `Login` varchar(35) NOT NULL DEFAULT 'xxx',
  `Password` varchar(16) NOT NULL DEFAULT 'xxx',
  `LoginEnabled` tinyint(1) NOT NULL DEFAULT -1,
  `Comment` varchar(132) DEFAULT NULL,
