  KEY `Country` (`Country`),
  KEY `StateRegion` (`StateRegion`),
  KEY `Language` (`Language`),
  KEY `Status` (`Status`),
  CONSTRAINT `Person_ibfk_11` FOREIGN KEY (`AcademicTitle`) REFERENCES `AcademicTitle` (`AcademicTitle`) ON UPDATE CASCADE
